import React, { useContext } from 'react'
import CartContext from '../../store/cart-context';
import Card from '../UI/Card/Card';
import classes from './SettingCart.module.css';

export const SettingCart = () => {
  
  const {onHideCart, totalAmount} = useContext(CartContext);
  
  return (
    <Card className={classes.setting}>
      <header>
        totalAmount: {totalAmount}$
      </header>
      <footer></footer>
       <button className={classes.close} 
          onClick={onHideCart}>Close</button>
       <button>Order</button>
    </Card>
  )
}
